import * as React from 'react';
import styles from './Button.module.scss';

type ButtonProps = {
  backgroundFull?: boolean;
  text: string;
  color?: 'blue' | 'red';
}

const Button = ({ backgroundFull, text, color = 'blue' }: ButtonProps) => (
  <button
    type="button"
    className={backgroundFull ? `${styles.fullButton} && ${styles.emptyButton}` : styles.emptyButton}
  >
    {text}
  </button>
);

export default Button;
